import React from 'react';
import './App.css';
import Blog from './templates/Blog';
import Header from './templates/Header';

function App() {
  return (
    <div className="App">
      <Header/>
      <main className="Main">
        <Blog/>
      </main>
    </div>
  );
}

export default App;
